window.scwQuantityPlugin=window.scwQuantityPlugin||{},window.SEMICOLON_quantityInit=function(t){if((t=t.filter(":not(.customjs)")).length<1)return!0;$(".plus").off("click").on("click",(function(){let t=$(this).parents(".quantity").find(".qty"),n=t.val(),e=t.attr("step")||1,i=t.attr("max");if(i&&Number(n)>=Number(i))return!1;if(/^\d+$/.test(n)){let i=Number(n)+Number(e);t.val(i).change()}else t.val(Number(e)).change();return!1})),$(".minus").off("click").on("click",(function(){let t=$(this).parents(".quantity").find(".qty"),n=t.val(),e=t.attr("step")||1,i=t.attr("min");if((!i||i<0)&&(i=1),/^\d+$/.test(n)){if(Number(n)>Number(i)){let i=Number(n)-Number(e);t.val(i).change()}}else t.val(Number(e)).change();return!1}))};